import React from 'react';
import {
    SidebarContainer,
    Icon, 
    CloseIcon,
    SidebarMenu,
    SidebarLink,
    SidebarBtn,
    SidebarWrapper
} from './SidebarElements';
import gitlab from '../../images/GitLab.png'


const Sidebar = () => {
    return (
        <SidebarContainer>
            <Icon>
                <CloseIcon />
            </Icon>
            <SidebarWrapper>
                <SidebarMenu>
                    <SidebarLink to='/'><span>Home</span></SidebarLink>
                    <SidebarLink to='/download'>Download</SidebarLink>
                    <SidebarLink to='/about'>About</SidebarLink>
                </SidebarMenu>
                <SidebarBtn to='/gitlab'>
                        <img src={gitlab} width="55"/>
                </SidebarBtn>
            </SidebarWrapper>
        </SidebarContainer>
    );
};

export default Sidebar;
